[[File:Seed pack detail.png|left|150px]]
A '''seed pack''' is a reward from [[Guildmaster Jane]] for completing a [[farming contract]].

Each [[farming contract]] has a difficulty from Tier 1 to Tier 5. For example, Tier 1 contracts represent short Easy contracts such as growing potatoes, whereas Tier 5 rewards would include long Hard contracts such as growing a [[magic tree]]. The tier of each contract is listed on [[Guildmaster Jane]]'s page.

Taking from a seed pack rewards the player with one roll on the reward table. The player may keep taking seeds until all seeds are removed from the seed pack.{{CiteTwitter|author=Mod Tide|url=https://twitter.com/jagextide/status/1125733839899377666|archiveurl=https://archive.fo/OFtGl|archivedate=7 May 2020|quote=This should be it.}}

Upon death the seed pack will always be destroyed.

{{Clear|left}}

